       return a + b;
   }
   int result = add(2, 3);
   ```

   *After constant folding:*
   ```c
   int result = 5;
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used. This helps to reduce the size of the compiled code and improve performance.

   *Before optimization:*
   ```c
   int foo(int x) {
       int y = x * 2;
       int z = y + 1;
       return z;
   }
   int result = foo(5);
   ```

   *After DCE:*
   ```c
   int result = foo(5);
   ```

3. **Common Subexpression Elimination (CSE)**: CSE identifies and eliminates redundant expressions by computing them only once and storing the result. This helps to reduce the number of instructions and improve performance.

   *Before optimization:*
   ```c
   int bar(int a, int b) {
       int x = a + b;
       int y = a + b; // redundant expression
       return x + y;
   }
   ```

   *After CSE:*
   ```c
   int bar(int a, int b) {
       int x = a + b;
       return x + x;
   }
   ```

